import './Navigation.css';
import React from 'react';
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Typography from '@material-ui/core/Typography'
import IconButton from '@material-ui/core/IconButton'
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom';
import logo from './bd_logo.png';

const Navigation = () => {
  return(
    <div>
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu">
          <img src={logo} style={{height: "50px", width: "50px", borderRadius: "200/2"}} />
          </IconButton>
          <Typography variant="h3" fontFamily='"Product Sans", serif' color="inherit">
            BREAKDOWN
          </Typography>
          <Link to="/">
            <Button variant="outlined" color="white">Home</Button>
          </Link>
          <Button color="inherit">Upload</Button>
          <Button color="inherit">Trending</Button>
          <Button color="inherit">Profile</Button>
          <Button color="inherit">Logout</Button>
        </Toolbar>
      </AppBar>
    </div>
  )
}
export default Navigation;
